import React from "react";
import styles from "../styles/navbar.module.css";
import navdata from "../Data/navdata";
import { useDisplay } from "../Provider";
import MusicPlayer from "./MusicPlayer";
import Producer from "./Producer";
export default function Navbar() {
  const { index } = useDisplay();
  if (navdata[index].type === "nav") {
    return (
      <div className={styles.navbar}>

        <h4 style={{margin:"0px"}}> {navdata[index].title}</h4>
        {navdata[index].data.map((d) => {
          console.log(d.name);

          return <Producer data={d} index={index} />;
        })}
      </div>
    );
  } else if (navdata[index].type === "music") {
    {
      console.log("call music");
    }
    return <MusicPlayer />;
  }

  return;
}
